import mobileTarif from "./mobile_tarif.png";

export function ServiceCard() {
    return (
        <div style={{
          width: '100vw',
          minHeight: '100vh',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center'
        }}>
            <div style={{
              width: '50%',
              height: '52%',
              background: '#af9370b2',
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center',
              padding: '20px',
              borderRadius: '15px'
            }}>
                <h2 style={{
                  fontFamily: 'Kyiv Type Titling',
                  fontSize: '40px',
                  color: '#a65b00',
                  textAlign: 'center',
                  WebkitTextStroke: '0.1px black'
                }}>Домашний интернет</h2>
                
                <img 
                  src={mobileTarif}
                  alt="Home Internet"
                  style={{
                    width: '428px',
                    height: '241px',
                    borderRadius: '15px',
                    display: 'block'
                  }}
                />
                
                <p style={{
                  fontFamily: 'Handjet',
                  fontSize: '24px',
                  color: '#000000',
                  textAlign: 'center',
                  marginTop: '20px',
                  maxWidth: '416px'
                }}>
                  Быстрый и надежный интернет для вашего дома. Стабильное соединение, выгодные тарифы, поддержка 24/7.
                </p>
            </div>
        </div>
    );
}
